import React, { useState, useEffect } from 'react';
import './App.css';
import StockCard from './components/StockCard';
import AnalysisModal from './components/AnalysisModal';
import SearchCard from './components/SearchCard';
import Dashboard from './components/Dashboard';

function App() {
  const [realTimeData, setRealTimeData] = useState({
    'AAPL': { 
      price: 175.43, 
      change: 2.15, 
      changePercent: 1.24,
      company: 'Apple Inc.',
      sector: 'Technology',
      marketCap: '2.8T',
      volume: '45.2M',
      pe: 28.5
    },
    'GOOGL': { 
      price: 2847.50, 
      change: -15.30, 
      changePercent: -0.53,
      company: 'Alphabet Inc.',
      sector: 'Technology',
      marketCap: '1.9T',
      volume: '1.2M',
      pe: 24.1
    },
    'TSLA': { 
      price: 248.90, 
      change: 8.75, 
      changePercent: 3.64,
      company: 'Tesla Inc.',
      sector: 'Automotive',
      marketCap: '790B',
      volume: '85.3M',
      pe: 65.2
    },
    'MSFT': { 
      price: 342.18, 
      change: 4.22, 
      changePercent: 1.25,
      company: 'Microsoft Corp.',
      sector: 'Technology',
      marketCap: '2.5T',
      volume: '28.7M',
      pe: 32.8
    },
    'AMZN': { 
      price: 3156.78, 
      change: -22.45, 
      changePercent: -0.71,
      company: 'Amazon.com Inc.',
      sector: 'E-commerce',
      marketCap: '1.6T',
      volume: '3.1M',
      pe: 58.3
    },
    'NVDA': { 
      price: 875.32, 
      change: 18.90, 
      changePercent: 2.21,
      company: 'NVIDIA Corp.',
      sector: 'Technology',
      marketCap: '2.1T',
      volume: '42.8M',
      pe: 45.7
    }
  });

  const [selectedStock, setSelectedStock] = useState(null);
  const [showModal, setShowModal] = useState(false);
  const [predictionResult, setPredictionResult] = useState(null);

  // Update real-time data
  useEffect(() => {
    const interval = setInterval(() => {
      setRealTimeData(prevData => {
        const newData = { ...prevData };
        Object.keys(newData).forEach(symbol => {
          const stock = newData[symbol];
          const priceChange = (Math.random() - 0.5) * 2;
          stock.price += priceChange;
          stock.change += priceChange;
          stock.changePercent = (stock.change / (stock.price - stock.change)) * 100;
          
          if (stock.price < 10) stock.price = 10;
          if (stock.price > 5000) stock.price = 5000;
        });
        return newData;
      });
    }, 3000);

    return () => clearInterval(interval);
  }, []);

  const handleStockClick = (symbol) => {
    setSelectedStock(symbol);
    setShowModal(true);
  };

  const closeModal = () => {
    setShowModal(false);
    setSelectedStock(null);
  };

  const handlePredictStock = (symbol) => {
    const stock = realTimeData[symbol];
    if (!stock) return;

    const predictedPrice = (stock.price * (1 + (Math.random() * 0.2 - 0.1))).toFixed(2);
    const change = ((predictedPrice - stock.price) / stock.price * 100).toFixed(2);
    const confidence = (Math.random() * 30 + 60).toFixed(0);

    setPredictionResult({
      symbol,
      company: stock.company,
      currentPrice: stock.price,
      predictedPrice: parseFloat(predictedPrice),
      change: parseFloat(change),
      confidence: parseInt(confidence)
    });
  };

  return (
    <div className="App">
      <div className="container">
        <header className="header">
          <h1>ðŸš€ MarketVision Pro</h1>
          <p>Next-Gen Stock Analysis & Prediction Platform âœ¨</p>
        </header>

        <section className="featured-stocks">
          <h2 className="section-title">ðŸ”¥ Trending Stocks</h2>
          <div className="stocks-grid">
            {Object.keys(realTimeData).map(symbol => (
              <StockCard
                key={symbol}
                symbol={symbol}
                stock={realTimeData[symbol]}
                onClick={() => handleStockClick(symbol)}
              />
            ))}
          </div>
        </section>

        <section className="analysis-section">
          <SearchCard
            onPredict={handlePredictStock}
            predictionResult={predictionResult}
            realTimeData={realTimeData}
          />
        </section>

        <Dashboard realTimeData={realTimeData} />
      </div>

      {showModal && selectedStock && (
        <AnalysisModal
          symbol={selectedStock}
          stock={realTimeData[selectedStock]}
          onClose={closeModal}
        />
      )}
    </div>
  );
}

export default App;
